import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';

const Navbar = () => {
  const [searchQuery, setSearchQuery] = useState('');
  const navigate = useNavigate();

  const handleSearch = (e) => {
    e.preventDefault();
    if (searchQuery.trim()) {
      // Implement search functionality
      console.log('Searching for:', searchQuery);
    }
  };

  return (
    <nav className="bg-white shadow-lg border-b-4 border-nba-blue">
      <div className="container mx-auto px-4">
        <div className="flex justify-between items-center h-16">
          {/* Logo and App Name */}
          <Link to="/" className="flex items-center space-x-3">
            <div className="w-10 h-10 bg-gradient-to-br from-nba-blue to-nba-red rounded-lg flex items-center justify-center">
              <span className="text-white font-bold text-xl">üèÄ</span>
            </div>
            <span className="text-2xl font-bold gradient-text">NBA Analytics Pro</span>
          </Link>

          {/* Search Bar */}
          <div className="flex-1 max-w-lg mx-8">
            <form onSubmit={handleSearch} className="relative">
              <input
                type="text"
                placeholder="Search teams, players, stats..."
                value={searchQuery}
                onChange={(e) => setSearchQuery(e.target.value)}
                className="w-full px-4 py-2 pl-10 pr-4 text-gray-700 bg-gray-100 border border-gray-300 rounded-full focus:outline-none focus:border-nba-blue focus:ring-2 focus:ring-nba-blue focus:ring-opacity-20"
              />
              <div className="absolute left-3 top-2.5">
                <svg className="w-5 h-5 text-gray-400" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M21 21l-6-6m2-5a7 7 0 11-14 0 7 7 0 0114 0z" />
                </svg>
              </div>
            </form>
          </div>

          {/* Navigation Links */}
          <div className="flex items-center space-x-6">
            <Link 
              to="/" 
              className="text-gray-700 hover:text-nba-blue font-medium transition-colors duration-200"
            >
              Dashboard
            </Link>
            <Link 
              to="/analytics" 
              className="text-gray-700 hover:text-nba-blue font-medium transition-colors duration-200"
            >
              Analytics
            </Link>
            <Link 
              to="/predictions" 
              className="text-gray-700 hover:text-nba-blue font-medium transition-colors duration-200"
            >
              Predictions
            </Link>
            <button className="btn-primary">
              Get Started
            </button>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
